import React from "react";

const Form = () => {
	return (
		<React.Fragment>
			<form>
				<input
					className='too-'
					type='text'
					placeholder='Enter task'
				/>
				<button>
					<i class='fa fa-plus-circle' aria-hidden='true'></i>
				</button>
			</form>
		</React.Fragment>
	);
};

export default Form;
